import React from 'react';
import {Text, View, StyleSheet} from 'react-native';

export default class MapScreen extends React.Component {
    constructor(props) {
        super(props);
        this.user = null;
    }

    set theUser(user) {
        this.user = user;
    }

    get theUser() {
        return this.user;
    }

    render() {
        return (
            <View>
                <Text>Welcome to the map view!</Text>
            </View>
        );
    }
}

const styles = StyleSheet.create({});
